    function getName(){
    //const response = await fetch(url);
    //const name = await response.json();
    const name = ZodiacSignsDetail;
    setName(name);
    console.log(name);

  }
    
  useEffect(()=>{
    getName();

  },[]);


 
  return(
    <BrowserRouter>
    <router>
       <div className="container">  
    
    <ul className="users">
      {ZodiacSignsDetail.map((ZodiacSignsDetail)=>{
          return(
              <li>
              <route path='./zodiac'><img  id='logo' src={ZodiacSignsDetail.ZodiacSignImageUrl } alt={name.ZodiacSignImageUrl}/></route>  
                  <div>
                     <h4>{ZodiacSignsDetail.Name}</h4> 
                     <h4>{ZodiacSignsDetail.MyanmarMonth}</h4> 
                     <h6>{ZodiacSignsDetail.Dates}</h6>
                                          
                  </div>
              </li>
          )
      })}
    </ul>
    
   </div>
    </router>
    </BrowserRouter>
   
  );
}
export default Card;
